(1857, 730, 292, 11, '聽天使說', '', '2007-12-31 00:00:00', 0000, 15, 0, 4, '', '作曲：吳听徹．陳亭慧(iRene)\n填詞：吳听徹．陳亭慧\n編曲：吳听徹．許逸喬\n監製：吳听徹\n\n仰望天空　是怎樣的氣候\n別想看透　雲背後思念纏繞的漩渦\n陽光可以灑落\n想你　卻無法逆流\n我的不捨　誰替我說一說\n\n請告訴我　你那邊的氣候\n我也會想懂　天使們的生活\n雨水輕易滴落\n想念　卻沒辦法乘風\n只能守候　回憶中你的溫柔\n\n聽天使說　祂脆弱的雙手\n沒有用盡力氣挽留是因為\n神　諭知的結果\n\n聽天使說　她一定抱緊我\n在夜最黑暗時候　讓曙光降落\n\n請告訴我　你那邊的氣候\n我也會想懂　天使們的生活\n雨水輕易滴落\n想念　卻沒辦法乘風\n只能守候　回憶中你的溫柔\n\n聽天使說　祂脆弱的雙手\n沒有用盡力氣挽留是因為\n神　諭知的結果\n\n聽天使說　她一定抱緊我\n在夜最黑暗時候　讓曙光降落\n別淚流\n\n聽天使說　祂脆弱的雙手\n沒有用盡力氣挽留是因為\n神　諭知的結果\n\n聽天使說　她一定抱緊我\n在夜最黑暗時候　讓曙光降落\n\n用最溫暖的雙手', 256, '', '', '', '', '', '', 1, 1, 0, '2008-04-16 23:26:23', '2015-03-12 13:31:00', '0000-00-00 00:00:00'),
