(1907, 745, 298, 8, '小雨', '', '2008-04-17 00:00:00', 0000, 15, 0, 5, '', '作詞：黃藍白 / 作曲：黃藍白 / 編曲：黃藍白 \n小雨下來了 \n我們已無勁聊 \n所以我把雨衣放上 \n讓你知道 \n別以為我習慣寂寞無聊 \n但願你撐的到明瞭 \n我就是這麼地喜歡你 \n如果有一天 \n我發現你地身邊多了一個我 \n微風就慢慢飄流 \n小雨輕輕吹向一個我 \n吧啦吧吧我會從記得已發生 \n讓你躺在我身上 \n慢慢慢地天空又放晴了 \n嗨晴了 \n小雨下了 \n我怕你太無聊 \n所以我把手放在一旁 \n想懂你想 \n不想讓你方才覺得感動 \n沒想到你真的無聊 \n我就是這麼的喜歡你 \n如果有一天 \n我發現你地身邊多了一個我 \n微風就慢慢飄流 \n小雨輕輕吹向一個我 \n吧啦吧吧我會全記得你的所有 \n讓你躺在我身上 \n慢慢慢地天空又放晴了 \n過得慢慢慢地天空又放晴了', 218, '', '', '', '', '', '', 1, 1, 0, '2008-04-17 03:01:25', '2015-03-12 13:31:01', '0000-00-00 00:00:00'),
(1908, 745, 298, 9, '當閃亮來臨時', '', '2008-04-17 00:00:00', 0000, 15, 0, 5, '', '明天我是要到何處\n就在閃亮快樂時結束\n有天我們還是忙碌\n一同等待下個神秘旅途\n明天你是要到何處\n就在閃亮快樂時結束\n有一天當問他生來是如\n一同等待下個神秘旅途\n我想你知道我想你明了\n我想他知道哦他明了\n他永遠在我的心裡存住\n我想你知道我想你明了\n總在他那方相聚才明了\n他永遠在我的心裡存住\n明天我是要到何處\n就在閃亮快樂時結束\n有一天當問他生來是如\n一同等待下個神秘旅途\n我想你知道我想你明了\n我想他知道哦他明了\n他永遠在我的心裡存住\n我想你知道我想你明了\n我在他的方相聚才明了\n他永遠在我的心裡存住\n我想你知道我想你明了\n我想他知道哦他明了\n他永遠在我的心裡存住\n我想你知道我想你明了\n我在他的方相聚才明了\n他永遠在我的心裡存住\n明天\n等待着我們\n明天\n就在閃亮快樂時結束\n', 237, '', '', '', '', '', '', 1, 1, 0, '2008-04-17 03:05:08', '2015-03-12 13:31:01', '0000-00-00 00:00:00'),
