(1932, 1, 282, 3, '無聲的輪廓', '', '2008-04-19 00:00:00', 0000, 10, 0, 7, '', '沈默的話　無聲的輪廓\n\n不用說\n\n濃豔的妝　掩藏的面容\n\n看不透\n\n盛開的花　垂死的驕縱\n\n正如我\n\n燃盡的香　縈繞的念頭\n\n而愛　是我說不出的輪廓\n\n而愛　是我藏不住的面容\n\n璀璨的星　閃爍的溫柔\n\n誰能懂\n\n熟悉的人　陌生的惶恐\n\n沒想過\n\n前方的門　迷宮的盡頭\n\n走不走\n\n漫長的夜　孤單的自由\n\n而愛　是我最懵懂的溫柔\n\n而愛　是我最熟悉的惶恐\n\n而愛　是我跨不過的盡頭\n\n而愛　是我最壓抑的自由\n\n我甦醒\n\n在沈默的夜裡劃破了空氣\n\n那裡\n\n有偽裝的藉口和透明的聲音\n\n褪去\n\n那裝扮的面容和防衛的面具\n\n抓緊\n\n曾規避的溫柔和埋藏的勇氣\n\n而那剝離的光景\n\n在我視線之中朦朧的身影\n\n是你\n\n是你\n\n讓我寧靜地尋覓', 296, '', '', '', '', '', '', 1, 1, 0, '2008-04-18 19:38:09', '2015-03-12 13:31:02', '0000-00-00 00:00:00'),
