(1939, 146, 339, 4, '友情值千金', '我並不是隨時都想唱這首歌。\r\n它目前面臨的最大爭議是，\r\n我是自己把它寫出來，\r\n抑或是在曲的部份與楊士毅有共同創作的部份？\r\n但毫無疑問地它開始於我們一起在地下道的即興表演。\r\n他是我以前樂團（Alcohol）的吉他手，今年二十三歲，\r\n現在重新了他的音樂創作。\r\n雖然我們曾經有過愉快與空白，\r\n友情值千金這首歌的意義就在於，\r\n（對我而言在於）\r\n友誼一旦刻在心上，\r\n你找不到方法將它撫平，\r\n因為那次力道比當時的我們想像的更強。', '2008-04-19 00:00:00', 0000, 0, 1, 5, '真的很高興　　在寒冷的夜裡　能看到你在這裡\r\n雖然有過紛爭　雖然曾經遠離　但你還是在這裡\r\n還是很高興　　在十九歲冬季　我們還能在一起\r\n十九歲會過去　我們都會老去　但我們還在一起\r\n\r\n我想是因為\r\n\r\n友情值千金\r\n友情值千金\r\n友情值千金\r\n\r\n別忘了你的好朋友\r\n別忘了你的好朋友\r\n他們在遠方想著你\r\n他們在遠方想著你\r\n\r\n一年它過去了\r\n夏天正等著呢\r\n因為有你陪著\r\n我們都長大了\r\n\r\n好想要問問你\r\n你那裡的天氣\r\n還有沒有下雨\r\n還有沒有哭泣', '', 0, '鄭焙隆', '鄭焙隆', '鄭焙隆', '', '', '', 0, 0, 1, '2008-04-15 15:25:38', '2013-10-07 17:11:47', '0000-00-00 00:00:00'),
