(1944, 152, 0, 1, '酸啤酒俱樂部(FLAT CLUB)', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, '午夜十點半\r\n寂寞的舞台\r\n你穿著假的APE而來\r\n什麼時候學人把帽子戴歪歪\r\n \r\n開始總是彆扭不自在\r\n酒過三巡便又放浪行駭\r\n重複戲碼每夜在循環\r\n就好像罐頭舞曲每夜在循環\r\n \r\nWoo~\r\nWoo~\r\n這遊戲我很習慣\r\n \r\n用最冷的眼神\r\n高傲的蔑笑\r\n用面不改色雷達\r\n快速地掃描\r\n用指間的汗水\r\n交換彼此害臊\r\n用不自然的腔調\r\n掩飾饑渴嘴角\r\n \r\nHoliday\r\nHi!Lady\r\nHoliday\r\nHi!Lady\r\n \r\n一邊舉杯又\r\n一邊拒絕\r\n一邊睥睨又\r\n乞求安慰\r\n \r\n這遊戲我很喜歡\r\n\r\n這遊戲我很喜歡\r\n \r\n凌晨四點半\r\nDJ趕下班\r\n散場音樂單調的節拍\r\n今晚又是空手而歸的夜晚\r\n \r\n但他們摟睡在汽車賓館\r\n而他們到了中和吃早餐\r\n剩下的煙屁股和啤酒罐\r\n難堪的空虛還是每晚再循環', '', 0, '', 'IAN/Tzara/英傑', 'Tzara', '', '', '', 0, 0, 1, '2008-04-18 20:14:02', '2013-10-07 17:11:47', '0000-00-00 00:00:00'),
